import React from "react";
import Button from "./Button";

// const Header = () => {}    function Header() {}
class Header extends React.Component {
  render() {
    return (
      <header className="header">
        {this.props.title}
        <Button />
        <Button text="Button" />
      </header>
    );
  }
}

export default Header;
